import React from "react";
import './index.css';
import {
    Link,
    NavLink
} from "react-router-dom";

import Signup from "./Signup.js";

function HPNavBar(){
    return(
        
        <div className="navBar" id="homePageNB">
            <ul id="hpURLList">
                <li>Virtual Version</li>
                <li className="nvUpperRightOptions"><Link to="/login"><button>Log in</button></Link></li>
                <li className="nvUpperRightOptions"><Link to="/signup"><button>Sign up</button></Link></li>
            </ul>
        </div>
    );
}

export default HPNavBar;
